class RenderPropsPart2_click extends Component {
  render() {
    return (
      <div>
        const {count, incrementCount} = this.state
    return <button onClick={incrementCount}>Clicked {count} times</button>
      </div>
    )
  }
}

export default RenderPropsPart2_click
